import { getDesigne } from "../../data/data";
import { useParams } from "react-router-dom";
import { UserNav } from "../Navbar/homeNav";
import { StlViewer } from "react-stl-file-viewer";
import cube from '../../images/stlFiles/cube.stl'

export default function DesignInfo(){
    let param = useParams();
    let design=getDesigne(param.designInfo);
    let url="../../images/stlFiles/cube.stl"
    return(
        <div>
            <UserNav/>

        <div className="designInfo">

            <StlViewer
                url='https://storage.googleapis.com/ucloud-v3/ccab50f18fb14c91ccca300a.stl'
                width={200}
                height={200}
                modelColor='#B92C2C'
                backgroundColor='#EAEAEA'
                />
            <h3>{design.name}</h3>
            <p>{design.info}</p>

        </div>
        </div>
    )


}
